In 2018, breast augmentation was the top surgical cosmetic procedure performed in the United States with ~314,000 total cases in which 88% were silicone and 12% were saline [2].

Silicone implants are pre-filled with silicone gel which are intended to mimic natural breast tissue. They are available to women age 22 and older for breast augmentation. Saline breast implants are inserted empty into the patient and then filled with sterile water. They are available to women age 18 and older for breast augmentation. Both types are available to women of any age for breast reconstruction [3].

